import { AUTH } from '../constants/actionTypes';

import * as api from '../api/index.js';

export const signin = (formData) => async (dispatch) => {
  try {
    // login
    history.pushState("/")
  } catch (error) {
    console.log(error.message);
  }
};

export const signup = () => async (dispatch) => {
    try {
        // sign up
        history.pushState("/")
    } catch (error) {
      console.log(error.message);
    }
  };
